The story takes place in 1348 in plague-ridden medieval England. Osmund (Eddie Redmayne), a young monk, has unbeknownst to his brothers fallen in love with Averill (Kimberley Nixon), a young girl who took sanctuary in the monastery. He believes it is no longer safe and sends her home to the forest. She asks him to join her, but he declines on account of his vows, after which she tells him she will wait for him at the edge of the forest by a marker for one week. Soon after, Osmund prays that God will give him a sign, as he wishes to leave to join her. As he is doing so, an envoy from the bishop enters the Church looking for a guide to a village not far from where Osmund's love Averill was to wait for him. Osmund takes this as a sign and volunteers to lead the envoy, a knight named Ulric (Sean Bean), and his group of soldiers to a remote marshland village which has remained untouched by the Black Death......


